script: |
  super -f text -I q1969.spq | sort > q1969.out

inputs:
  - name: q1969.spq
    data: |
      SELECT - col2 col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + ( - 50 ) * CAST ( + 77 AS REAL ) + + + 9 >= col0 OR + 37 - + col2 > - col0 * col1 + + - col1 * col0;
  - name: tab0

outputs:
  - name: q1969.out
    data: |
      -10
      -47
      -99
